    public static final String adAbouts = "[{\"id\":624974358394588016,\"header\":\"1.Digital art is true\",\"subheader\":\"A summary of the vision\",\"subheader2\":\"2 minute read\",\"article\":\"Joseph was developed out of an urge to present art in alternative ways.As a consequence of digitalization the idea of digital space emerges as well.\\nWhat exactly is digital space and how does it appear?\\n\",\"desc\":\"The way of reinterpreting an exhibition is fascinating and motivating enough to implement those ideas. In the end, Joseph himself became a work of art and the metaphor:\\n\\\"The expression travels through space\\\"\\n is the message that comes from the heart of the matter.\\nTo show that this can be seen by humans and thus by a work of art, we have to accept that digital art is true.\\nThe authenticity of a thing primarily determines its value and that is precisely why we have to admit it.\\nThe world is in a steady emergent process what was morally right today is where possible wrong tomorrow, but nothing like that with art, it goes timelessly through time. A solid component that can be reinterpreted over and over again. But every story is technologically influenced and if we think about it further, we can make the case that there is not only a digital work of art but also a digital space, because every thing is an instance of space.\\nThen the willingness to authenticate a thing is the acceptance of the room itself. Joseph was built to underline that thought.\\nDigital art is true.\\nThe more our world emerges digitally, the more we will believe in it.\"}]";

